window.bookSummaryJSON = "<p>All hail the queen…</p> <p>Once, I tried to escape the monsters who made me. When that failed, I hid inside my diamond shell, so no one would know the truth.</p> <p>Now everyone knows. I’m no longer Gloria Walton, the reigning queen of Willow Heights Prep Academy. The tables have turned. Now I’m the whipping girl, and someone else sits on the throne.</p> <p>She can have it. I don’t want it.</p> <p>All I want is him. Colt Darling, the rebel boy I bullied for years. The new queen’s boyfriend. The one person in the world who knew the girl behind the smiles I faked all along.</p> <p>But Colt doesn’t want me.</p> <p>He wants revenge.</p> <p>**This book contains dark themes and adult themes and situations suitable for 18+ listeners with no triggers.</p>"; 
